import React from 'react'
import './card.css'

export default function Card(img, Title) {
    return (
        <div>
            <div className="card">
                <div className="img-holder"></div>
                <div className="card-title"></div>                   
            </div>
            <h4>Feature</h4>
        </div>
    )
}
